import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { getMoviesreducer } from "../../DataSystem/ReduxStates/slices/MovieSlice";





const Home = () => {


    const token = useSelector(state => state.Promise.value);
    const dispatch = useDispatch();
    dispatch(getMoviesreducer(token));







    return (
        <div>
            <h1>Home</h1>
            <button onClick={() => dispatch(getMoviesreducer())}>Get Movies</button>
            {movies.map(movie => (
                <div key={movie.id}>
                    <h2>{movie.title}</h2>
                    <p>{movie.description}</p>
                </div>
            ))}
        </div>
    )
}

export default Home
